import React from 'react';

import SHOPDATA from './ShopData'

class Shop extends React.Component {
	constructor(props) {
		super(props);

		this.state = {
			collection : ShopData
		}
	}

	render() {
		return (
			<div>SHOP PAGE</div>
		)
	}
}


export default Shop;
